import ReactDOM from 'react-dom';
import './index.css';
import App from './App';


const elem = (
  <div>
    <h2>Hello za warudo!</h2>
    <input type='text' />
    <button />
  </div>
);


ReactDOM.render(
  elem,
  document.getElementById('root')
);
